import React, { Component } from "react";
import "./App.css";
import locData from "./result.json";
import { Map, TileLayer, Marker, Popup } from "react-leaflet";

const position = [51.505, -0.09];

class App extends Component {
  getMarker(key) {
    let lat = locData[key]["lat"];
    let lng = locData[key]["lng"];
    console.log(key + " " + lat + " " + lng);
    return <Marker position={[lat, lng]} />;
  }

  render() {
    // console.log(Object.keys(locData));
    // Object.keys(locData).forEach(key => {
    //   console.log(key + " " + locData[key]);
    // });
    return (
      <Map center={position} zoom={13}>
        <TileLayer
          url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
          attribution='&copy; <a href="http://osm.org/copyright">OpenStreetMap</a> contributors'
        />
        {Object.keys(locData).forEach(key => this.getMarker(key))};
      </Map>
    );
  }
}

export default App;
